import { useState } from "react";
import "./App.css";

const API_BASE_URL =
  process.env.REACT_APP_API_BASE_URL ?? "http://localhost:3167";

function App() {
  const [phase, setPhase] = useState("player1");
  const [playerOneDraft, setPlayerOneDraft] = useState("");
  const [playerTwoDraft, setPlayerTwoDraft] = useState("");
  const [playerOneDescription, setPlayerOneDescription] = useState("");
  const [playerTwoDescription, setPlayerTwoDescription] = useState("");
  const [results, setResults] = useState([]);
  const [isSubmitting, setIsSubmitting] = useState(false);
  const [errorMessage, setErrorMessage] = useState("");

  const handlePlayerOneSubmit = () => {
    if (!playerOneDraft.trim()) {
      setErrorMessage("Please describe Player 1's wizard before submitting.");
      return;
    }

    setErrorMessage("");
    setPlayerOneDescription(playerOneDraft.trim());
    setPhase("player2");
  };

  const handlePlayerTwoSubmit = async () => {
    if (!playerTwoDraft.trim()) {
      setErrorMessage("Please describe Player 2's wizard before submitting.");
      return;
    }

    setErrorMessage("");
    setIsSubmitting(true);
    setPlayerTwoDescription(playerTwoDraft.trim());
    setResults([]);

    const descriptions = [
      { key: "player1", body: playerOneDraft.trim() },
      { key: "player2", body: playerTwoDraft.trim() },
    ];

    try {
      await Promise.all(
        descriptions.map(async ({ key, body }) => {
          const response = await fetch(`${API_BASE_URL}/generate_wizard`, {
            method: "POST",
            headers: {
              "Content-Type": "application/json",
            },
            body: JSON.stringify({ prompt: body }),
          });

          if (!response.ok) {
            throw new Error(`${key} generation failed with status ${response.status}`);
          }

          const data = await response.json();
          setResults((prev) => [...prev, { key, data }]);
        })
      );
    } catch (error) {
      setErrorMessage(
        error instanceof Error
          ? `Failed to generate wizards. ${error.message}`
          : "Failed to generate wizards."
      );
    } finally {
      setIsSubmitting(false);
    }
  };

  return (
    <div className="app">
      <h1 className="title">Wizard Battle</h1>

      {phase === "player1" && (
        <section className="prompt-card">
          <label htmlFor="player-one-prompt" className="prompt-label">
            Player 1, describe your wizard
          </label>
          <textarea
            id="player-one-prompt"
            className="prompt-input"
            value={playerOneDraft}
            onChange={(event) => setPlayerOneDraft(event.target.value)}
            placeholder="Describe your wizard..."
          />
          <button className="prompt-button" onClick={handlePlayerOneSubmit}>
            Submit
          </button>
          {errorMessage && <p className="error-message">{errorMessage}</p>}
        </section>
      )}

      {phase === "player2" && (
        <section className="prompt-card">
          <label htmlFor="player-two-prompt" className="prompt-label">
            Player 2 describe your wizard
          </label>
          <textarea
            id="player-two-prompt"
            className="prompt-input"
            value={playerTwoDraft}
            onChange={(event) => setPlayerTwoDraft(event.target.value)}
            placeholder="Describe your wizard..."
          />
          <button
            className="prompt-button"
            onClick={handlePlayerTwoSubmit}
            disabled={isSubmitting}
          >
            {isSubmitting ? "Generating..." : "Submit"}
          </button>
          {errorMessage && <p className="error-message">{errorMessage}</p>}
        </section>
      )}

      {!!results.length && (
        <section className="prompt-card">
          <h2 className="summary-title">Generated Wizards</h2>
          {results.map(({ key, data }) => (
            <div key={key} className="api-result">
              <h3 className="summary-subtitle">
                {key === "player1" ? "Player 1" : "Player 2"}
              </h3>
              <pre className="api-result__pre">
                {JSON.stringify(data, null, 2)}
              </pre>
            </div>
          ))}
        </section>
      )}
    </div>
  );
}

export default App;
